code.value:
#ifdef RFE_HW_ENABLE_RANGE_CHECK
    //input parameter range check
    RFE_ERROR_GUARD
    {
        // DEFAULT VALUE FOR SIGMA-DELTA ORDER IS 3. API FOR CHANGING IS NOT ENABLED YET.
        // TODO: COMPARE TO MAXCODE RELATIVE TO SETTING OF SIGMA-DELTA
        if ( lox2BiasCode > RFE_HW_RFBIST_LOX2_BIAS_MAXCODE )
        {
            RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
        }
        else
        {
            // Continue
        }
    }
#endif
    RFE_ERROR_GUARD
    {
                rfeHwSpi_modify( RFE_HW_SPI_RX_BIST_MODULE,
                                 RFE_HW_RXBIST_RF_PWR_REG,
                                 RFE_HW_RXBIST_RF_PWR_LOX2_CTRL_MSK,
                                 ( ( rfeHwSpi_register32_t ) lox2BiasCode ) << RFE_HW_RXBIST_RF_PWR_LOX2_CTRL_SHF,
                                 RFE_ERROR_FUNCTION_ARGUMENT );
    }

#ifdef RFE_HW_ENABLE_RANGE_CHECK
    //input parameter range check
    RFE_ERROR_GUARD
    {
        // DEFAULT VALUE FOR SIGMA-DELTA ORDER IS 3. API FOR CHANGING IS NOT ENABLED YET.
        // TODO: COMPARE TO MAXCODE RELATIVE TO SETTING OF SIGMA-DELTA
        if ( ssbBuff1GainCode > RFE_HW_RFBIST_SSB_BUFFER_MAXCODE
             || ssbBuff2GainCode > RFE_HW_RFBIST_SSB_BUFFER_MAXCODE
             || dacBiasCode > RFE_HW_RFBIST_DAC_BIAS_MAXCODE )
        {
            RFE_ERROR_SET( rfe_error_rxbistInvalidSsbCode_e );
        }
        else
        {
            // Continue
        }
    }
#endif
    RFE_ERROR_GUARD
    {
        rfeHwSpi_register32_t regValue;
        rfeHwSpi_register32_t regMask;

        regValue = ( ( ( rfeHwSpi_register32_t ) ssbBuff1GainCode ) << RFE_HW_RXBIST_RF_PWR_SSB_GAIN_BUFFER1_SHF );
        regValue |= ( ( ( rfeHwSpi_register32_t ) ssbBuff2GainCode ) << RFE_HW_RXBIST_RF_PWR_SSB_GAIN_BUFFER2_SHF );
        regValue |= ( ( ( rfeHwSpi_register32_t ) dacBiasCode ) << RFE_HW_RXBIST_RF_PWR_DAC_TRIM_BIAS_SHF );

        regMask = RFE_HW_RXBIST_RF_PWR_SSB_GAIN_BUFFER1_MSK;
        regMask |= RFE_HW_RXBIST_RF_PWR_SSB_GAIN_BUFFER2_MSK;
        regMask |= RFE_HW_RXBIST_RF_PWR_DAC_TRIM_BIAS_MSK;

        rfeHwSpi_modify( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RF_PWR_REG, regMask, regValue, RFE_ERROR_FUNCTION_ARGUMENT );
    }

#ifdef RFE_HW_ENABLE_RANGE_CHECK
    //input parameter range check
    RFE_ERROR_GUARD
    {
        // DEFAULT VALUE FOR SIGMA-DELTA ORDER IS 3. API FOR CHANGING IS NOT ENABLED YET.
        // TODO: COMPARE TO MAXCODE RELATIVE TO SETTING OF SIGMA-DELTA
        if ( frequencyCode1 > RFE_HW_RFBIST_FREQUENCY_MAXCODE || frequencyCode2 > RFE_HW_RFBIST_FREQUENCY_MAXCODE
             || amplitudeCode1 > RFE_HW_RFBIST_AMPLITUDE_MAXCODE_SD4 || amplitudeCode2 > RFE_HW_RFBIST_AMPLITUDE_MAXCODE_SD4
             || phaseCode1 > RFE_HW_RFBIST_PHASE_MAXCODE || phaseCode2 > RFE_HW_RFBIST_PHASE_MAXCODE )
        {
            RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
        }
        else
        {
            // Continue
        }
    }
#endif
    RFE_ERROR_GUARD
    {
        rfeHwSpi_register32_t regValue;

        // Writing tone frequency register
        regValue = ( ( ( rfeHwSpi_register32_t ) frequencyCode1 ) << RFE_HW_RXBIST_IF_FREQ_IF1_FREQ_SHF );
        regValue |= ( ( ( rfeHwSpi_register32_t ) frequencyCode2 ) << RFE_HW_RXBIST_IF_FREQ_IF2_FREQ_SHF );
        rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_FREQ_REG, regValue , RFE_ERROR_FUNCTION_ARGUMENT );

        // Writing tone amplitude register
        regValue = ( ( ( rfeHwSpi_register32_t ) amplitudeCode1 ) << RFE_HW_RXBIST_IF_AMP_IF1_AMP_SHF );
        regValue |= ( ( ( rfeHwSpi_register32_t ) amplitudeCode2 ) << RFE_HW_RXBIST_IF_AMP_IF2_AMP_SHF );
        rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_AMP_REG, regValue , RFE_ERROR_FUNCTION_ARGUMENT );

        // Writing tone phase register
        regValue = ( ( ( rfeHwSpi_register32_t ) phaseCode1 ) << RFE_HW_RXBIST_IF_PHASE_IF1_PH_INIT_SHF );
        regValue |= ( ( ( rfeHwSpi_register32_t ) phaseCode2 ) << RFE_HW_RXBIST_IF_PHASE_IF2_PH_INIT_SHF );
        rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_PHASE_REG, regValue , RFE_ERROR_FUNCTION_ARGUMENT );
    }

rfeHwSpi_register32_t modeCode = 0ul;
RFE_ERROR_GUARD
{
    switch ( mode )
    {
        case rfeHwRxbist_ifMode_doubleCw_e:
            modeCode = 0ul;
            break;
        case rfeHwRxbist_ifMode_doubleSquare_e:
            modeCode = 1ul;
            break;
        case rfeHwRxbist_ifMode_dcLevel_e:
            modeCode = 2ul;
            break;
        case rfeHwRxbist_ifMode_inlDnlTest_e:
            modeCode = 3ul;
            break;
        default:
            RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
            break;
    }
}
modeCode <<= RFE_HW_RXBIST_RXBIST_MODE_IF_MODE_SHF;
rfeHwSpi_modify ( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_MODE_REG, RFE_HW_RXBIST_RXBIST_MODE_IF_MODE_MSK, modeCode, RFE_ERROR_FUNCTION_ARGUMENT );

RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t spiRegValue;

    //enable clock and bitstream
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_TRIG_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    //RXBIST.IF_TRIG.TRIG_SOURCE=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_IF_TRIG_TRIG_SOURCE_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_IF_TRIG_TRIG_SOURCE_BIT );      // clear bit

    //RXBIST.IF_TRIG.TRIG_START=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_IF_TRIG_TRIG_START_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_IF_TRIG_TRIG_START_BIT );      // set bit

    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_TRIG_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    // this file is to initialize the defaults values that need changed from HW default values
    rfeHwSpi_modify(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_BBBIST_REG, RFE_HW_RXBIST_BBBIST_CM_SEL_MSK, ( 0x0ul << RFE_HW_RXBIST_BBBIST_CM_SEL_SHF), RFE_ERROR_FUNCTION_ARGUMENT);
    rfeHwSpi_modify(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_SPARE_OUT_REG, RFE_HW_RXBIST_SPARE_OUT_SPARE_ANALOG_MSK, ( 0x80000ul << RFE_HW_RXBIST_SPARE_OUT_SPARE_ANALOG_SHF), RFE_ERROR_FUNCTION_ARGUMENT);
}

RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t spiRegValue, backupSpiRegValue;

    // RxBIST is in off state. GLDO1 is enabled + GBIAS for LLDO

    // enable the level shifters
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, RFE_ERROR_FUNCTION_ARGUMENT);
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_PON_CTL_PON_LS_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_PON_CTL_PON_LS_BIT );      // set bit
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    backupSpiRegValue = spiRegValue;

    // wait 1us for levelshifters to be on
    //Remove the following sleep since SPI takes more, also for ES2.
    // RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_1us );

    // bypass RC filters of LDOs, all at once
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_LDO_CTL_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    spiRegValue |= ( ( 1ul << RFE_HW_RXBIST_LDO_CTL_LDO_LO_BP_FILT_BIT ) |
                    ( 1ul << RFE_HW_RXBIST_LDO_CTL_LDO_RF_BP_FILT_BIT ) |
                    ( 1ul << RFE_HW_RXBIST_LDO_CTL_LDO_DIG_BP_FILT_BIT ) );

    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_LDO_CTL_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    //Remove the following sleep since SPI takes more, also for ES2.
    // RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_1us );

    // Swap spiRegValue and backupSpiRegValue
    spiRegValue = spiRegValue + backupSpiRegValue;
    backupSpiRegValue = spiRegValue - backupSpiRegValue;
    spiRegValue = spiRegValue - backupSpiRegValue;

    // ENable 0v9 LLDO
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_PON_CTL_LDO_LO_EN_BIT );      // set bit
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    // Delay between LDOs enable
    //Remove the following sleep since SPI takes more, also for ES2.
    // RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_1us );

    // Enable 1v1 LLDo
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_PON_CTL_LDO_RF_EN_BIT );      // set bit
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    // Delay between LDOs enable
    //Remove the following sleep since SPI takes more, also for ES2.
    // RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_1us );

    // Enable 0v9 dig LDO
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_PON_CTL_LDO_DIG_EN_BIT );      // set bit
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    // wait 10us for LLDO to be enabled
    RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_30us );

    // disable bypass RC filters of LDOs, all at once
    spiRegValue = backupSpiRegValue;

    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_LDO_CTL_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_LDO_CTL_LDO_LO_BP_FILT_BIT ) ); // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_LDO_CTL_LDO_RF_BP_FILT_BIT ) ); // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_LDO_CTL_LDO_DIG_BP_FILT_BIT ) ); // clear bit

    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_LDO_CTL_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t spiRegValue;

    //  ***** sequence to pass from standby to ON on baseband mode

    // RxBIST must be in standby state before this sequence.

    // Disable RC filter of the IP
    // RXBIST.PON_CTL.FAST_ENABLE_M7=1;
    rfeHwSpi_setBit(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, RFE_HW_RXBIST_PON_CTL_FAST_ENABLE_M7_BIT, RFE_ERROR_FUNCTION_ARGUMENT);

    // RXBIST_EN
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    // MAke sure RF mode is disabled
    //RXBIST.RXBIST_EN.SSB_BIAS_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_SSB_BIAS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_SSB_BIAS_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.DAC_BUF1_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF1_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF1_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.DAC_BUF2_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF2_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF2_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.LOX2_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.LOX2_BIAS_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_BIAS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_BIAS_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.PR_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PR_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PR_EN_BIT );      // clear bit

    // write all bits at once
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_1us );

    // make sure PPDs are disabled
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, RFE_ERROR_FUNCTION_ARGUMENT);      

    //RXBIST.RXBIST_EN.PPD_SSB_BUF_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_BUF_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_BUF_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.PPD_SSB_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.PPD_LO_BUF_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_BUF_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_BUF_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.PPD_LO_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.PPD_VGA_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_VGA_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_VGA_EN_BIT );      // clear bit

    // write all bits at once
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    //Enable BB mode
    //RXBIST.RXBIST_MODE.BISTRX_MODE=1;
    rfeHwSpi_setBit(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_MODE_REG, RFE_HW_RXBIST_RXBIST_MODE_BISTRX_MODE_BIT, RFE_ERROR_FUNCTION_ARGUMENT);
    RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_1us );

    //Enable BB and RF common blocks
    //RXBIST.RXBIST_EN.PSDAC_BIAS_EN=1;
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_BIAS_EN_BIT ) ); // mask bitss
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_BIAS_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.PSDAC_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_EN_BIT );      // set bit

    //Enable BB mode
    //RXBIST.RXBIST_MODE.BISTRX_MODE=1;
    rfeHwSpi_setBit(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_MODE_REG, RFE_HW_RXBIST_RXBIST_MODE_BISTRX_MODE_BIT, RFE_ERROR_FUNCTION_ARGUMENT);

    //Enable BB and RF common blocks
    //RXBIST.RXBIST_EN.BBBIST_CM_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_CM_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_CM_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.BBBIST_FOLLO_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_FOLLO_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_FOLLO_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.BBBIST_LVLS_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_LVLS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_LVLS_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.BBBIST_RAUCH_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_RAUCH_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_RAUCH_EN_BIT );      // set bit

    // write all bits at once
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    // wait 1us for everything to be enabled
    RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_1us );

    // Enable RC filter of the IP
    //RXBIST.PON_CTL.FAST_ENABLE_M7=0;
    rfeHwSpi_clearBit(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, RFE_HW_RXBIST_PON_CTL_FAST_ENABLE_M7_BIT, RFE_ERROR_FUNCTION_ARGUMENT);
}

RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t spiRegValue;

    //  ***** sequence to pass from standby to ON on RF mode

    // RxBIST must be in standby state before this sequence.

    // Disable RC filter of the IP
    //RXBIST.ON_CTL.FAST_ENABLE_M7=1;
    rfeHwSpi_setBit(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, RFE_HW_RXBIST_PON_CTL_FAST_ENABLE_M7_BIT, RFE_ERROR_FUNCTION_ARGUMENT);

    // RXBIST_EN
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    // Make sure BB mode is disabled

    // RXBIST.RXBIST_EN.BBBIST_CM_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_CM_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_CM_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.BBBIST_FOLLO_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_FOLLO_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_FOLLO_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.BBBIST_LVLS_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_LVLS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_LVLS_EN_BIT );      // clear bit

    //RXBIST.RXBIST_EN.BBBIST_RAUCH_EN=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_RAUCH_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_RAUCH_EN_BIT );      // clear bit  

    // RXBIST_EN write all bits at once
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_1us );

     // RXBIST_EN
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    //Enable BB and RF common blocks
    //RXBIST.RXBIST_EN.PSDAC_BIAS_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_BIAS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_BIAS_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.PSDAC_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_EN_BIT );      // set bit

    // Enable RF mode blocks
    //RXBIST.RXBIST_EN.LOX2_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.LOX2_BIAS_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_BIAS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_BIAS_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.PR_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PR_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PR_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.SSB_BIAS_EN=1;        
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_SSB_BIAS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_SSB_BIAS_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.DAC_BUF1_EN=1;       
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF1_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF1_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.DAC_BUF2_EN=1;        
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF2_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF2_EN_BIT );      // set bit

    //Enable PPDs
    //RXBIST.RXBIST_EN.PPD_SSB_BUF_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_BUF_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_BUF_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.PPD_SSB_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.PPD_LO_BUF_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_BUF_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_BUF_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.PPD_LO_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_EN_BIT );      // set bit

    //RXBIST.RXBIST_EN.PPD_VGA_EN=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_VGA_EN_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_VGA_EN_BIT );      // set bit

    // RXBIST_EN write all bits at once
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    //Enable RF mode
    //RXBIST.RXBIST_MODE.BISTRX_MODE=0;
    rfeHwSpi_clearBit(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_MODE_REG, RFE_HW_RXBIST_RXBIST_MODE_BISTRX_MODE_BIT, RFE_ERROR_FUNCTION_ARGUMENT);

    // wait 5us for everything to be enabled (need to be optimized. 1 corner is above 1us)
    RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_5us );		

    // Enable RC filter of the IP
    //RXBIST.PON_CTL.FAST_ENABLE_M7=0;
    rfeHwSpi_clearBit(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, RFE_HW_RXBIST_PON_CTL_FAST_ENABLE_M7_BIT, RFE_ERROR_FUNCTION_ARGUMENT);
}

RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t spiRegValue;

    //  ***** sequence to pass from ON (RF or BB mode) to standby

    //Disable PPDs
    //RF mode switch to its default value
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    //BB mode is disabled       
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_CM_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_CM_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_FOLLO_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_FOLLO_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_LVLS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_LVLS_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_RAUCH_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_BBBIST_RAUCH_EN_BIT );      // clear bit

    //Disable BB and RF common blocks
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_BIAS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_BIAS_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PSDAC_EN_BIT );      // clear bit

    // Disable RF mode blocks
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_BIAS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_LOX2_BIAS_EN_BIT );

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PR_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PR_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_SSB_BIAS_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_SSB_BIAS_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF1_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF1_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF2_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_DAC_BUF2_EN_BIT );      // clear bit

    //Disable PPDs
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_BUF_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_BUF_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_BUF_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_BUF_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_EN_BIT );      // clear bit

    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_VGA_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_RXBIST_EN_PPD_VGA_EN_BIT );      // clear bit

    //Disable BB and RF common blocks, RF mode blocks, PPDs all at once
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    //RF mode switch to its default value
    //********* double check the default value
    rfeHwSpi_clearBit(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_MODE_REG, RFE_HW_RXBIST_RXBIST_MODE_BISTRX_MODE_BIT, RFE_ERROR_FUNCTION_ARGUMENT);
    RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_2us );
}

RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t spiRegValue;

    // RxBIST is in off state. GLDO1 is enabled + GBIAS for LLDO

    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    // disable 0v9 LLDO
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_PON_CTL_LDO_LO_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_PON_CTL_LDO_LO_EN_BIT );      // clear bit

    //sleep(1);				// Delay between LDOs enable

    // disable 1v1 LLDO
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_PON_CTL_LDO_RF_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_PON_CTL_LDO_RF_EN_BIT );      // clear bit

    //sleep(1);				// Delay between LDOs enable

    // disable 0v9 dig LDO
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_PON_CTL_LDO_DIG_EN_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_PON_CTL_LDO_DIG_EN_BIT );      // clear bit

    // disable 0v9 LLDO, 1v1 LLDO, 0v9 dig LDO all at once
    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );

    //Remove the following sleep since SPI takes more, also for ES2.
    // RFE_WAIT_USEC ( RFE_RX_BIST_WAIT_1us );

    //disable the level shifters
    rfeHwSpi_clearBit(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_PON_CTL_REG, RFE_HW_RXBIST_PON_CTL_PON_LS_BIT, RFE_ERROR_FUNCTION_ARGUMENT);
}

RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t spiRegValue;

    // Full scale amplitude 1 tone
    rfeHwSpi_modify( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_AMP_REG, RFE_HW_RXBIST_IF_AMP_IF1_AMP_MSK, ( ( rfeHwSpi_register32_t ) 15359ul << RFE_HW_RXBIST_IF_AMP_IF1_AMP_SHF ), RFE_ERROR_FUNCTION_ARGUMENT );

    //1MHz Frequency 
    rfeHwSpi_modify( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_FREQ_REG, RFE_HW_RXBIST_IF_FREQ_IF1_FREQ_MSK, ( ( rfeHwSpi_register32_t ) 819ul << RFE_HW_RXBIST_IF_FREQ_IF1_FREQ_SHF ), RFE_ERROR_FUNCTION_ARGUMENT );

    //enable clock and bitstream
    spiRegValue = rfeHwSpi_read(RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_TRIG_REG, RFE_ERROR_FUNCTION_ARGUMENT);

    //RXBIST.IF_TRIG.TRIG_SOURCE=0;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_IF_TRIG_TRIG_SOURCE_BIT ) ); // mask bits
    spiRegValue |= ( 0ul << RFE_HW_RXBIST_IF_TRIG_TRIG_SOURCE_BIT );      // clear bit

    //RXBIST.IF_TRIG.TRIG_START=1;
    spiRegValue &= ( ~( 1ul << RFE_HW_RXBIST_IF_TRIG_TRIG_START_BIT ) ); // mask bits
    spiRegValue |= ( 1ul << RFE_HW_RXBIST_IF_TRIG_TRIG_START_BIT );      // set bit

    rfeHwSpi_write( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_TRIG_REG, spiRegValue, RFE_ERROR_FUNCTION_ARGUMENT );
}

RFE_ERROR_GUARD
{
    //RXBIST.IF_TRIG.TRIG_STOP =0;
    rfeHwSpi_setBit( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_IF_TRIG_REG, RFE_HW_RXBIST_IF_TRIG_TRIG_STOP_BIT, RFE_ERROR_FUNCTION_ARGUMENT );
}

// TODO: Update the function... Seems not to be useful as of now. E.g. Both PPDs should not be enabled.
// However if a person uses this function in the wrong order (enable one PPD and then disable the other) VGA would be disabled

#ifdef RFE_HW_ENABLE_RANGE_CHECK
//input parameter range check
RFE_ERROR_GUARD
{
    if ( ( selectedPpd > rfeHwRxbist_ppd_selection_ssb_e ) || ( vgaGain > rfeHw_ppd_vga_gain_20db_e ) )
    {
        RFE_ERROR_SET( rfe_error_parameterOutOfRange_e );
    }
    else
    {
        //do nothing
    }
}
#endif
RFE_ERROR_GUARD
{
    rfeHwSpi_register32_t rxbistEnReg;
    rxbistEnReg = rfeHwSpi_read ( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, RFE_ERROR_FUNCTION_ARGUMENT );
    //RXBIST LOX2 PPD is selected
    if ( selectedPpd == rfeHwRxbist_ppd_selection_lox2_e )
    {
        //Enable the core and buffer of RXBIST LOX2 PPD
        rxbistEnReg &= ( ~ ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_BUF_EN_BIT ) ) & ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_EN_BIT ) );
        rxbistEnReg |= ( ( ( rfeHwSpi_register32_t ) enable ) << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_BUF_EN_BIT ) | ( ( ( rfeHwSpi_register32_t ) enable ) << RFE_HW_RXBIST_RXBIST_EN_PPD_LO_EN_BIT );
    }
    else //RXBIST SSB PPD is selected
    {
        //Enable the core and buffer of RXBIST SSB PPD
        rxbistEnReg &= ( ~ ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_BUF_EN_BIT ) ) & ( ~ ( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_EN_BIT ) );
        rxbistEnReg |= ( ( ( rfeHwSpi_register32_t ) enable ) << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_BUF_EN_BIT ) | ( ( ( rfeHwSpi_register32_t ) enable ) << RFE_HW_RXBIST_RXBIST_EN_PPD_SSB_EN_BIT );
    }
    // RXBIST SSB PPD and LOX2 PPD share the same VGA
    // Enable VGA for both PPDs
    rxbistEnReg &= ( ~( 1ul << RFE_HW_RXBIST_RXBIST_EN_PPD_VGA_EN_BIT ) );
    rxbistEnReg |= ( ( ( rfeHwSpi_register32_t ) enable ) << RFE_HW_RXBIST_RXBIST_EN_PPD_VGA_EN_BIT );
    rfeHwSpi_write ( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_EN_REG, rxbistEnReg, RFE_ERROR_FUNCTION_ARGUMENT );
    if ( enable == true )
    {
        //Set PPD VGA gain
        rfeHwSpi_register32_t ppdVgaGainValue;
        ppdVgaGainValue = ( rfeHwSpi_register32_t ) ( vgaGain << RFE_HW_RXBIST_RXBIST_MODE_PPD_VGA_GAIN_SHF );
        rfeHwSpi_modify ( RFE_HW_SPI_RX_BIST_MODULE, RFE_HW_RXBIST_RXBIST_MODE_REG, RFE_HW_RXBIST_RXBIST_MODE_PPD_VGA_GAIN_MSK, ppdVgaGainValue, RFE_ERROR_FUNCTION_ARGUMENT );
    }
    else
    {
        //do nothing
    }
}
